package javapractice3;

public class foreachloopexample {

	public static void main(String[] args) {
		// TODO Auto-generated method stub

		int ar[] = {8,9,6,5,8,4,6,5};
		
		// for each loop
		
		for (int a:ar) {
			System.out.print(a+" ");
		}
		
		String s[] = {"fvddf","vfsd", "rgrf" };
		for (String S1 : s) {
			System.out.print(S1+" ");
		}
	}

}
